import React from "react";

export const Tile = (props) => {

  const {name, description} = props;

  return (
    <div className="tile-container">
      <p className={"styles.title-title"}>{name}</p>
      <div>
        {description.map((item, index)=> 
        <p></p>

        )}
      </div>
      
    </div>
  );
};
